import binascii
import string

VALID = set([ord(c) for c in string.printable])

def encrypt(message, key):
    index = 0
    cipher = []

    for m in message:
        cipher.append(m ^ key[index])
        index = (index + 1) % len(key)

    return bytes(cipher)

cipher = ''
cipher = binascii.unhexlify(cipher)

for i in range(256):
    for j in range(256):
        k = bytes([i, j])
        p = encrypt(cipher, k)
        if all([c in VALID for c in p]):
            print(p.decode())
            print('=' * 90)

